pragma solidity ^0.4.17;


//学员领用以太币，一天最多只能领取一个
contract GetCoin {
    address owner;
    mapping (address=>uint) getRecord; //领用时间记录

    function GetCoin() {
        owner = msg.sender;
    }

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    //调用者向合约地址转入 msg.value 个以太币，单位是 wei
    function deposit() payable  returns  (address, uint) {
        return (msg.sender, msg.value);
    }

    //为addr发放一个1个以太币
    function getOneCoin(address addr) onlyOwner returns (uint) {
        uint preTime = getRecord[addr]; //上次领用时间
        require(now > preTime + 1 days);//一天最多领取一个
        getRecord[addr] = now; //记录最新领取时间
        addr.transfer(1 ether);
        return addr.balance;
    }

    //获得合约的地址和以太币
    function getContractAddrees() view returns (address, uint) {
        return (this, this.balance);
    }

    //获得addr的以太币
    function getBalance(address addr) view returns (uint) {
        return addr.balance;
    }
}
